import React, { useState } from "react";
import {
  Container,
  Typography,
  FormGroup,
  FormControlLabel,
  Checkbox,
  Button,
  Box,
  Snackbar,
  Card,
  CardMedia,
  CardContent,
} from "@mui/material";

const UkrainianCuisineSurvey = () => {
  const [selectedDishes, setSelectedDishes] = useState([]);
  const [snackbarOpen, setSnackbarOpen] = useState(false);

  // Список страв із картинками
  const dishes = [
    { name: "Борщ", img: "data:image/jpeg;base64,", description:"Борщ є символом української кухні. Традиційно готується на великі свята або сімейні зібрання, супроводжується пампушками з часниковим соусом." }, 
    { name: "Вареники", img: "data:image/jpeg;base64,", description: "Традиційна українська страва, яка асоціюється з родинним затишком. Вареники часто готуються з різними начинками, включаючи картоплю, сир, капусту чи ягоди, і подаються на великі свята чи обжинкові урочистості." },
    { name: "Деруни", img: "data:image/jpeg;base64,", description: "Ця страва зі смажених тертих картопляних млинців популярна в багатьох регіонах України. Деруни часто готують на сніданок і подають зі сметаною. У деяких регіонах є традиція святкування 'Дня дерунів'." },
    { name: "Котлета по-київськи", img: "data:image/jpeg;base64,", description: "Одна з найвідоміших українських страв на міжнародному рівні. Це куряча котлета з вершковим маслом всередині, яка стала символом ресторанної культури Києва і часто подається на офіційних заходах." },
    { name: "Голубці", img: "data:image/jpeg;base64,", description: "Традиційна страва, яку готують із капустяного листя, фаршированого м’ясом і рисом. Голубці є обов’язковим елементом різдвяного столу в багатьох сім’ях і символізують родинний достаток." },
    { name: "Пампушки", img: "data:image/jpeg;base64,", description: "Ці маленькі пухкі булочки зазвичай подають до борщу. Особливо популярні пампушки з часниковим соусом, які додають пікантності до святкового столу."},
    { name: "Київський торт", img: "https://cdn.lenta.com.ua/images/maxone/19619/19619-86d7782a8813f95ccf0ae6462be7e045.jpg", description: "Цей десерт є гордістю Києва. Він часто дарується як символ гостинності та святкувань на честь важливих подій." },
    { name: "Узвар", img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSuERpuYfqEyd_dZP06pQBBAlhaICPF1esXlQ&s", description: "Узвар — традиційний напій з сухофруктів. Його подають на Різдво разом із кутею як символ родинного затишку та достатку." },
  ];

  const handleCheckboxChange = (event) => {
    const { name, checked } = event.target;
    setSelectedDishes((prev) =>
      checked ? [...prev, name] : prev.filter((dish) => dish !== name)
    );
  };

  const handleSubmit = () => {
    console.log("Обрані страви:", selectedDishes);
    setSnackbarOpen(true);
  };

  const handleCloseSnackbar = () => {
    setSnackbarOpen(false);
  };

  return (
    <Container maxWidth="md" sx={{ marginTop: 4 }}>
      <Typography variant="h4" gutterBottom sx={{ color: "#fafa73", textShadow: "2px 2px 4px rgba(0, 0, 0, 0.7)", }}>
        Обери твої улюблені страви української кухні
      </Typography>
      <FormGroup>
        {dishes.map((dish) => (
          <Card
            key={dish.name}
            sx={{
              display: "flex",
              alignItems: "center",
              marginBottom: 2,
              padding: 1,
            }}
          >
            <CardMedia
              component="img"
              image={dish.img}
              alt={dish.name}
              sx={{ width: 200, height: 100, borderRadius: 1 }}
            />
            <CardContent sx={{ flex: 1 }}>
              <FormControlLabel
                control={
                  <Checkbox
                    name={dish.name}
                    onChange={handleCheckboxChange}
                    color="primary"
                  />
                }
                label={dish.name}
              />
              <Typography variant="body2" color="text.secondary">
                {dish.description}
              </Typography>
            </CardContent>
          </Card>
        ))}
      </FormGroup>
      <Box sx={{ marginTop: 2 }}>
        <Button
          variant="contained"
          color="secondary"
          onClick={handleSubmit}
          disabled={selectedDishes.length === 0}
        >
          Відправити
        </Button>
      </Box>
      <Snackbar
        open={snackbarOpen}
        autoHideDuration={3000}
        onClose={handleCloseSnackbar}
        message="Дякуємо за ваш вибір!"
      />
    </Container>
  );
};

export default UkrainianCuisineSurvey;
